    <style>
      /* ——— Ceno Variable (body & labels) ——— */
      @font-face {
        font-family: 'Ceno VF';
        src: url('./Fonts/Ceno/CenoVF.woff2') format('woff2-variations');
        font-weight: 100 900;
        font-style: normal;
        font-display: swap;
      }
      @font-face {
        font-family: 'Ceno VF';
        src: url('./Fonts/Ceno/CenoVF-ItalicOnly.woff2') format('woff2-variations');
        font-weight: 100 900;
        font-style: italic;
        font-display: swap;
      }

      /* ——— Meso Variable (headings) ——— */
      @font-face {
        font-family: 'Meso VF';
        src: url('./Fonts/Meso/MesoVF.woff2') format('woff2-variations');
        font-weight: 100 900;
        font-style: normal;
        font-display: swap;
      }
      @font-face {
        font-family: 'Meso VF';
        src: url('./Fonts/Meso/MesoVF-ItalicOnly.woff2') format('woff2-variations');
        font-weight: 100 900;
        font-style: italic;
        font-display: swap;
      }

      *, *::before, *::after { box-sizing: border-box; margin: 0; padding: 0; }
      body { -webkit-font-smoothing: antialiased; -moz-osx-font-smoothing: grayscale; }
    </style>

  <body>
    <div id="root"></div>
    <script type="module" src="/src/main.jsx"></script>
    <script src="https://mcp.figma.com/mcp/html-to-design/capture.js" async></script>
  <script id="figma-capture-mode">
  if (window.location.hash.includes('figmacapture')) {
    // Expand all scroll containers so full page is captured
    function expandForCapture() {
      document.querySelectorAll('*').forEach(el => {
        const s = el.style;
        if (s.overflowY === 'auto' || s.overflowY === 'scroll' ||
            s.overflow === 'auto' || s.overflow === 'scroll') {
          s.overflowY = 'visible';
          s.overflow = 'visible';
          s.height = 'auto';
          s.maxHeight = 'none';
        }
      });
      document.body.style.overflow = 'visible';
      document.body.style.height = 'auto';
      document.documentElement.style.overflow = 'visible';
      document.documentElement.style.height = 'auto';
    }
    // Run after React renders
    window.addEventListener('load', () => setTimeout(expandForCapture, 800));
  }
</script>
